const styles = {
  imageCooke: {
    width: 80,
    height: 80,
    objectFit: "contain",
    filter: "brightness(0) invert(1)",
  },

  button: {
    width: 50,
    height: 50,
    border: "none",
    backgroundColor: "transparent",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },

  buttonReject: {
    borderColor: "#512fa7",
    borderWidth:1,
    color: "#512fa7",
    border: "none",
    borderRadius: 15,
    padding: "8 16",
    fontSize: 14,
    cursor: 'pointer',
  },
};

export default styles;
